let chars_to_str cs = cs |> List.map (String.make 1) |> String.concat ""

let parse_line l =
  let words = l |> String.split_on_char '-' |> List.rev in
  let head = List.hd words in
  let i = String.index head '[' in
  let num = String.sub head 0 i |> int_of_string in
  let checksum = String.sub head (i+1) ((String.length head) - i - 2) in
  (num, checksum, words |> List.tl |> String.concat "")

let count_occurrences s =
  let add_char map c =
    let count = match Hashtbl.find_opt map c with
    | Some(count) -> count + 1
    | None -> 1 in
    Hashtbl.replace map c count;
    map
  in
  s |> String.to_seq |> Seq.fold_left add_char (Hashtbl.create (String.length s))

let valid_checksum (_, checksum, chars) =
  let char_map = count_occurrences chars in
  let compare_fn a b =
    let c1 = Hashtbl.find char_map a in
    let c2 = Hashtbl.find char_map b in
    if c1 = c2 then compare a b else c2 - c1 in
  let check = char_map
  |> Hashtbl.to_seq_keys
  |> List.of_seq
  |> List.sort compare_fn
  |> List.filteri (fun i _ -> i < 5) in
  chars_to_str check = checksum

let find_north_pole rooms =
  let decode_char num c = (Char.code c) - 97 + num mod 26 + 97 |> Char.chr in
  let decrypt_room (num, _, s) = (num, s |> String.map (decode_char num)) in
  let contains substr (_, s) =
    try let _ = Str.search_forward (Str.regexp substr) s 0 in true
    with Not_found -> false in
  rooms |> List.map decrypt_room |> List.find (contains "north") |> fst

let main () =
  let rooms = input |> Aoc.parse_lines parse_line in
  let part1 = rooms
  |> List.filter valid_checksum
  |> List.map (fun (x,_,_) -> x)
  |> List.fold_left (+) 0 in
  let part2 = rooms |> find_north_pole in
  (string_of_int part1, string_of_int part2)

let () = Aoc.timer main
